蘇澳城隍廟所在區域，曾是蘇澳鎮第一公墓。清光緒年間，在此區挖出一個金斗甕，甕內有骨骸及一把刻有「康大人」字樣的刀一把，即由民眾集資興建一座「康大人」小祠祭拜。但因廟宇簡陋，再由民眾予以重建，並改稱「萬善祠」。1904（明治37）年再次重建，並昇格為「大眾爺廟」。 　　1983年時，時任宜蘭縣長的陳定南贈匾「神恩澤被」，慶賀大眾爺廟晉昇為城隍廟，該廟即改稱「蘇澳城隍廟」。1991年時，因志成路開闢，故將城隍廟遷建現址，1997年入廟安座，並訂每年農曆5月13日為城隍爺聖誕千秋日。

